script: |
  super -f text -I q7333.spq | sort > q7333.out

inputs:
  - name: q7333.spq
    data: |
      SELECT 83 AS col2, col1 + - + col0 - - + ( + col2 ) * + col2 / - col2 + + col0 + + 27 / - col2 AS col1 FROM tab1 (FORMAT parquet);
  - name: tab1

outputs:
  - name: q7333.out
    data: |
      83	-21
      83	-54
      83	-82
